import React, {useState} from 'react';
import './Navbar.css';



function Navbar() {
    return (
        <>
            <nav className="navbar">
                <div className='navbar-container'>
                    Home
                </div>    
            </nav>
        </>
    )
        
    
}
export default Navbar
